func Hosts(first *int) ([]*model.Host, int) {
	var hosts = make([]*model.Host, 0)
	for i, h := range HostData {
		if first != nil && (i >= *first) {
			break
		}

		host := pd.Host{}
		err := json.Unmarshal([]byte(h.Attributes), &host)
		if err != nil {
			logrus.Error(err)
		}

		parentID := strings.Join(h.ParentPath, "|")
		hosts = append(hosts, &model.Host{
			ID:            h.ID,
			ParentID:      &parentID,
			Name:          *host.Name,
			Hostname:      host.Hostname,
			PrivateIPv4:   StrPtr(host.PrivateIPv4),
			PrivateIPv6:   host.PrivateIPv6,
			PublicIPv4:    host.PublicIPv4,
			PublicIPv6:    host.PublicIPv6,
			DNSName:       host.DNSName,
			PublicDNSName: host.PublicDNSName,
		})

	}

	return hosts, len(HostData)
}

func Vulnerabilities(first *int) ([]pd.Vulnerability, int) {
	var data = make([]pd.Vulnerability, 0)
	for i, h := range VulData {
		if first != nil && (int(i) >= *first) {
			break
		}

		item := pd.Vulnerability{}
		err := json.Unmarshal([]byte(h.Attributes), &item)
		if err != nil {
			logrus.Error(err)
		}
		data = append(data, item)

	}
	return data, len(VulData)
}

func StrPtr(item *string) string {
	if item != nil {
		return *item
	}
	return ""
}
